 to PTM manually	NO	\r\n21Β1656938	ATM to PTM manually	NO	\r\n21Β2588365	ATM to PTM manually	NO	\r\n21Β1142008	ATM to PTM manually	NO	\r\n21Β1367728	ATM to PTM manually	NO	\r\n21Β3112447	ATM to PTM manually	NO	\r\n21B1851396	ATM to PTM manually	NO	\r\n2101690285	ATM to PTM manually	NO	\r\n21Β2806647	ATM to PTM manually	NO	\r\n21Β3112518	ATM to PTM manually	NO	\r\n21Β1913468	ATM to PTM manually	NO	\r\n21Β2364134	ATM to PTM manually	NO	Επαναλαμβανόμενο fall back to ATM\r\n21Β1732081	ATM to PTM manually	NO	Επαναλαμβανόμενο επειτα από προγενεστερο χειροκινητο switch\r\n\r\n21Β1643852	ATM to PTM manually	NO	Επαναλαμβανόμενο επειτα από προγενεστερο χειροκινητο switch\r\n\r\n',1459328740),(2,7,0,2,3,'',1459328808),(3,2,0,2,1,'Το σύμπτωμα \"NO DHCP ANSWER/Εκκίνηση σε SAT MODE\" (το STB δεν μπορεί να συνδεθεί στην πλατφόρμα) αποκαθίσταται, σε Huawei και ISAM τεχνολογίες DSLAM, όταν αλλάξει το line mode από ADSL(φάσμα συχνοτήτων ADSL2+ και χρήση του ATM VLAN) σε VDSL(φάσμα συχνοτήτων VDSL και χρήση του PTM VLAN) και αντίστροφα. Στην συνέχεια, όταν γίνει επαναφορά στο αρχικό line mode στο οποίο λειτουργούσε η γραμμή του συνδρομητή όταν δηλώθηκε η βλάβη, το πρόβλημα επανέρχεται. Το πρόβλημα αυτό δεν μπορεί να παρουσιαστεί σε συνδρομητές που χρησιμοποιούν το ZTE 108NS modem ή DSLAM (παλαιού τύπου Huawei) που δεν μπορεί να εξυπηρετήσει τα VDSL line modes. ',1459246036),(4,2,0,3,1,'Αφορά συνδρομητές VDSL. Tο STB δεν μπορεί να συνδεθεί στην πλατφόρμα και προχωράει σε SAT mode, εάν γίνει αλλαγή από ATM mode σε PTM mode (ή αντίστροφα) είτε από το DSLAM είτε από το Router το πρόβλημα αποκαθίσταται. Όταν γίνει επαναφορά στο αρχικό mode το πρόβλημα παραμένει. Αυτό ίσχυε μέχρι και 30/3 όπου εμφανίστηκε περίπτωση (1-10772129502,1-10790827977) στην οποία μετα την επαναφορά σε PTM mode (αφού πρώτα έγινε διαγραφή και επανεγγραφή του PTM) το πρόβλημα αποκαταστάθηκε.',1459533087),(5,2,0,2,2,'',1459246036),(6,2,0,3,2,'Έχει σταλεί mail στο AN-NOC για διερεύνηση. ',1459533087),(7,2,0,2,3,'Το case αυτό έχει ήδη σταλεί στο AN-NOC για διερεύνηση (επισυναπτόμενο mail). Σε περίπτωση που αντιληφθείτε ξανά αυτό το πρόβλημα προτείνεται να γίνει προώθηση ticket και email στο NMC-DATA/IP με την περιγραφή του προβλήματος και παράκληση για έλεγχο ή προώθηση στο αρμόδιο τμήμα για διερεύνηση, αφού πρώτα έχει γίνει αλλαγή στο κατάλληλο mode έτσι ώστε να παρέχεται η υπηρεσία TV στον συνδρομητή.',1459246036),(8,2,0,3,3,'1-10670104355 1-10696424798',1459533087),(9,3,0,2,1,'HYBRID.REPLAY TV ΒΓΑΖΕΙ ΜΗΝΥΜΑ ΟΤΙ ΔΕΝ ΕΠΑΡΚΕΙ Η ΤΑΧΥΤΗΤΑ ΓΙΑ ΤΗΝ ΠΡΟΒΟΛΗ ΤΟΥ ΠΡΟΓΡΑΜΜΑΤΟΣ. ΟΤΑΝ ΕΠΙΛΕΓΕΙ ΛΗΨΗ ΔΕΝ ΜΠΟΡΕΙ ΝΑ ΔΕΙ ΤΟ ΠΡΟΓΡΑΜΜΑ ΟΛΟΚΛΗΡΟ.ΕΠΙΣΗΣ ΑΝΑΦΕΡΕΙ ΌΤΙ ΑΠΟΤΥΓΧΑΝΟΥΝ ΟΙ ΕΓΓΡΑΦΕΣ. \r\n',1459246210),(10,3,0,3,1,'Εμφανίζεται μήνυμα \"Δεν επαρκεί η ταχύτητα για την προβολή του προγράμματος\" παρόλο που ο συγχρονισμός και το διαθέσιμο throughput είναι παραπάνω από αρκετά. ΕΠΙΣΗΣ ΑΝΑΦΕΡΕΙ ΌΤΙ ΑΠΟΤΥΓΧΑΝΟΥΝ ΟΙ ΕΓΓΡΑΦΕΣ. \r\n',1459533820),(11,3,0,2,2,'Προτείνεται αλλαγή εξοπλισμού STB αφού έχουν αποκλειστεί όλες οι υπόλοιπες πιθανές αιτίες.',1459246210),(12,3,0,3,2,'Γίνονται οι εξής έλεγχοι: 1.Συγχρονισμού 2.Διασύνδεσης STB - Router 3.Χρήση του διαθέσιμου από τον συγχρονισμό Bandwidth (αν και δεν θα έπρεπε αφού υπάρχει προτεραιότητα υπέρ της TVσε L2 στο managed δίκτυο) 4.Φορέα που εξυπηρετεί το DSLAM (εάν υπάρχει botleneck στον φορέα θα φανεί στο Agama (1-10718988926)). Εάν δεν έχει εντοπιστεί το πρόβλημα στους παραπάνω ελέγχους, τότε προτείνεται η αλλαγή εξοπλισμού STB. ',1459533820),(13,3,0,2,3,'1-9952443008/1-10703943974',1459246210),(14,3,0,3,3,'1-9952443008/1-107039439740',1459533820),(15,6,0,2,2,'',1459256359),(16,6,0,3,2,'Ενδέχεται να έχει βάλει τόσο το scart όσο και το hdmi στις θύρες του STB. Αφήνει μόνο το ένα. ',1461738420),(17,3,0,3,3,'1-9952443008, 1-107039439740 1-10877820747, 1-10106689749, 1-10224970364, 1-10288007948, 1-10308525090, 1-10722609370, 1-10899718757, 1-10902032523, 1-10983236675, 1-10984515031, 1-10878545783, 1-10877139796, 1-10875033436, 1-10880136537, 1-10863602348, 1-10760159027, 1-10718548262, 1-10973671148, 1-11005778240, 1-11064739084',1461741841),(18,2,0,3,3,'1-10670104355 1-10696424798  1-10285972044,1-10989303400',1461741895),(19,3,0,2,2,'Γίνονται οι εξής έλεγχοι:<br/>1.Συγχρονισμού 2.Διασύνδεσης STB - Router 3.Χρήση του διαθέσιμου από τον συγχρονισμό Bandwidth (αν και δεν θα έπρεπε αφού υπάρχει προτεραιότητα υπέρ της TVσε L2 στο managed δίκτυο) 4.Φορέα που εξυπηρετεί το DSLAM (εάν υπάρχει botleneck στον φορέα θα φανεί στο Agama (1-10718988926)). Εάν δεν έχει εντοπιστεί το πρόβλημα στους παραπάνω ελέγχους, τότε προτείνεται η αλλαγή εξοπλισμού STB. ',1461749615),(20,3,0,2,2,'Γίνονται οι εξής έλεγχοι:<br/>1.Συγχρονισμού<br/>2.Διασύνδεσης STB - Router<br/>3.Χρήση του διαθέσιμου από τον συγχρονισμό Bandwidth (αν και δεν θα έπρεπε αφού υπάρχει προτεραιότητα υπέρ της TVσε L2 στο managed δίκτυο)<br/>4.Φορέα που εξυπηρετεί το DSLAM (εάν υπάρχει bottleneck στον φορέα θα φανεί στο Agama (1-10718988926)). Εάν δεν έχει εντοπιστεί το πρόβλημα στους παραπάνω ελέγχους, τότε προτείνεται η αλλαγή εξοπλισμού STB. ',1461749659),(21,3,0,2,2,'Γίνονται οι εξής έλεγχοι:<ol><li>1.Συγχρονισμού</li><li>2.Διασύνδεσης STB - Router</li><li>3.Χρήση του διαθέσιμου από τον συγχρονισμό Bandwidth (αν και δεν θα έπρεπε αφού υπάρχει προτεραιότητα υπέρ της TVσε L2 στο managed δίκτυο)</li><li>4.Φορέα που εξυπηρετεί το DSLAM (εάν υπάρχει bottleneck στον φορέα θα φανεί στο Agama (1-10718988926)).</li></ol>Εάν δεν έχει εντοπιστεί το πρόβλημα στους παραπάνω ελέγχους, τότε προτείνεται η αλλαγή εξοπλισμού STB. ',1461749746),(22,3,0,2,2,'Γίνονται οι εξής έλεγχοι:<ol><li>Συγχρονισμού</li><li>Διασύνδεσης STB - Router</li><li>Χρήση του διαθέσιμου από τον συγχρονισμό Bandwidth (αν και δεν θα έπρεπε αφού υπάρχει προτεραιότητα υπέρ της TVσε L2 στο managed δίκτυο)</li><li>Φορέα που εξυπηρετεί το DSLAM (εάν υπάρχει bottleneck στον φορέα θα φανεί στο Agama (1-10718988926)).</li></ol>Εάν δεν έχει εντοπιστεί το πρόβλημα στους παραπάνω ελέγχους, τότε προτείνεται η αλλαγή εξοπλισμού STB. ',1461749760),(23,11,0,3,2,'Υπό διερεύνηση, υπήρχε περίπτωση επίλυσης από SOC με αλλαγή max programs  από 3 σε 6. Έχει σταλεί σχετικό mail στις αρμόδιεσ υπηρεσίες, δεν έχουμε λάβει ακόμα απάντηση. Σε περίπτωση μη αποκατάστασης γίνεται activity στο NMC/DATA IP ',1461745974),(24,11,0,2,2,'Υπό διερεύνηση, υπήρχε περίπτωση επίλυσης από SOC με αλλαγή max programs από 3 σε 6. Έχει σταλεί σχετικό mail στις αρμόδιες υπηρεσίες, δεν έχουμε λάβει ακόμα απάντηση. Σε περίπτωση μη αποκατάστασης γίνεται activity στο [b]NMC/DATA IP[/b] ',1461750372),(25,17,0,3,2,'Αφού έχουμε κάνει όλους τους γνωστούς ελέγχους που αφορούν την τεχνολογία του DSL κάνουμε τους παρακάτω ελέγχους: 1.Έλεγχος από το Agama (και από cacti) για περίπτωση μαζικής βλάβης 2. Απενεργοποίηση της Εξοικονόμησης ενέργειας από το STB 3.Δοκιμή με καλώδιο HDMI τύπου 1.4 ή 2.0 (αυτό που περιέχεται με τον εξοπλισμό είναι τύπου 1.3) ή με άλλου τύπου διασύνδεση STB - TV (SCART, optical κ.λ.π.), πολύ πιθανόν τα μαυρίσματα να είναι πρόβλημα καλωδίου ή ασυμβατότητας. Εάν δεν έχει εντοπιστεί πρόβλημα στους παραπάνω ελέγχους τότε προτείνεται η αλλαγή εξοπλισμού STB.',1461750099),(26,17,0,2,2,'Αφού έχουμε κάνει όλους τους γνωστούς ελέγχους που αφορούν την τεχνολογία του DSL κάνουμε τους παρακάτω ελέγχους:\r\n[list=1]\r\n[*]Έλεγχος από το Agama (και από cacti) για περίπτωση μαζικής βλάβης\r\n[*]Απενεργοποίηση της Εξοικονόμησης ενέργειας από το STB\r\n[*]Δοκιμή με καλώδιο HDMI τύπου 1.4 ή 2.0 (αυτό που περιέχεται με τον εξοπλισμό είναι τύπου 1.3) ή με άλλου τύπου διασύνδεση STB - TV (SCART, optical κ.λ.π.), πολύ πιθανόν τα μαυρίσματα να είναι πρόβλημα καλωδίου ή ασυμβατότητας.\r\n[/list] Εάν δεν έχει εντοπιστεί πρόβλημα στους παραπάνω ελέγχους τότε προτείνεται η αλλαγή εξοπλισμού STB.',1461753710),(27,20,0,3,1,'Ο συνδρομητής εισάγει το SID και το νούμερο της συνδρομητικής κάρτας και όταν πατήσει το κουμπί OK εμφανίζεται το μύηνμα: \"Λάθος PIN συνδρομητικής κάρτας\".',1461754087),(28,20,0,2,1,'Ο συνδρομητής εισάγει το SID και το νούμερο της συνδρομητικής κάρτας και όταν πατήσει το κουμπί OK εμφανίζεται το μύνημα: [quote=Λάθος PIN συνδρομητικής κάρτας][/quote]',1461756428),(29,20,0,3,2,'Το πρόβλημα αυτό παρατηρείται σε περιπτώσεις πρώτης σύνδεσης με την νέα HYBRID πλατφόρμα ή μετά από αλλαγή εξοπλισμού STB (KAON, TECHNICOLOR). To προβλημα προκύπτει από την ροή του IT όπου δεν καταφέρνει να περάσει τα στοιχεία του νέου εξοπλισμού στην πλατφόρμα. Σε αυτή την περίπτωση θα πρέπει να γίνει έλεγχος εάν ο συνδρομητής βάζει τα σωστά στοιχεία και αφού επιβεβαιωθεί αυτό γίνεται activity στην πλατφόρμα TV για έλεγχο (αν όντως πρόκειται για αυτήν την περίπτωση). Εάν η πλατφόρμα TV επιβεβιαώσει το πρόβλημα τότε γίνεται επικοινωνία και activity με το 1st Level προκειμένου να αποσταλεί STT (αντικατάσταση της διαδικασίας Remedy) στο IT για αποκατάσταση του προβλήματος. Μία άλλη αιτία (πολύ πιο σπάνια) που μπορεί να προκαλεί το σύμπτωμα είναι να μην έχει ολοκληρωθεί η διαδικασία αλλαγής εξοπλισμού STB ή παραλαβής νέου STB από την παραγγελιοληψία (λάθος εμπορικού). Σε αυτήν την περίπτωση πρέπει πάλι να ενημερωθεί το πρώτο επίπεδο προκειμένου να αποκταστήσει το πρόβλημα (βλέπε συν. email).   ',1461754087),(30,20,0,2,2,'[list]\r\n[*]Το πρόβλημα αυτό παρατηρείται σε περιπτώσεις πρώτης σύνδεσης με την νέα HYBRID πλατφόρμα ή μετά από αλλαγή εξοπλισμού STB (KAON, TECHNICOLOR). To προβλημα προκύπτει από την ροή του IT όπου δεν καταφέρνει να περάσει τα στοιχεία του νέου εξοπλισμού στην πλατφόρμα. Σε αυτή την περίπτωση θα πρέπει να γίνει έλεγχος εάν ο συνδρομητής βάζει τα σωστά στοιχεία και αφού επιβεβαιωθεί αυτό γίνεται activity στην πλατφόρμα TV για έλεγχο (αν όντως πρόκειται για αυτήν την περίπτωση). Εάν η πλατφόρμα TV επιβεβιαώσει το πρόβλημα τότε γίνεται επικοινωνία και activity με το 1st Level προκειμένου να αποσταλεί STT (αντικατάσταση της διαδικασίας Remedy) στο IT για αποκατάσταση του προβλήματος. \r\n[*]Μία άλλη αιτία (πολύ πιο σπάνια) που μπορεί να προκαλεί το σύμπτωμα είναι να μην έχει ολοκληρωθεί 