u: [b]Ρυθμίσεις > Ρυθμίσεις Video > Αναλογία και ανάλυση[/b].\r\n[/list] Εάν δεν έχει εντοπιστεί πρόβλημα στους παραπάνω ελέγχους τότε προτείνεται η αλλαγή εξοπλισμού STB.',1464161972),(52,13,0,3,2,'Τα κανάλια αυτά είναι protective μέσω του προτοκόλου HDCP και κάποιες τηλεοράσεις δεν μπορούν να τα δουν μέσω HDMI. Ζητήθηκε από την πλατφόρμα να γίνεται καταγραφή του μοντέλου της τηλεόρασης. Ενημέρωση με mail στο HTVNOC. Με το νέο fw update σε 2.1.1 θα προστεθούν επιπλέον μοντέλα τηλεοράσεων που θα υποστηρίζουν το προτόκολλο HDCP. Η βλάβη γίνεται άρση και ενημερώνεται ο συνδρομητής.',1461746205),(53,13,0,3,2,'Τα κανάλια αυτά είναι protective μέσω του προτοκόλου HDCP και κάποιες τηλεοράσεις δεν μπορούν να τα δουν μέσω HDMI. Ζητήθηκε από την πλατφόρμα να γίνεται καταγραφή του μοντέλου της τηλεόρασης. Ενημέρωση με mail στο HTVNOC. Με το νέο fw update σε 2.2.1.1 θα προστεθούν επιπλέον μοντέλα τηλεοράσεων που θα υποστηρίζουν το προτόκολλο HDCP. Η βλάβη γίνεται άρση και ενημερώνεται ο συνδρομητής.',1464162063),(54,12,0,3,2,'Αφού έχουμε πιστοποιήσει ότι το πρόβλημα δεν οφείλεται σε άλλη αιτία που (πρόβλημα multicast κίνησης προς το DSLAM) γίνεται αποστολή mail και activity στο NMC/DAT IP για παραμετροποίηση των profiles ανά DSLAM από AN-NOC.',1461746086),(55,12,0,3,2,'Αφορά DSLAM τεχνολογίας ISAM.\r\nΑφού έχουμε πιστοποιήσει ότι το πρόβλημα δεν οφείλεται σε άλλη αιτία που (πρόβλημα multicast κίνησης προς το DSLAM) γίνεται αποστολή mail και activity στο NMC/DATA IP για παραμετροποίηση των profiles ανά DSLAM από AN-NOC.',1464165267),(56,2,0,35,3,'1-10670104355 1-10696424798 1-10285972044,1-10989303400 1-11284146026 1-11469571585',1464375622),(57,3,0,37,3,'1-9952443008, 1-107039439740 1-10877820747, 1-10106689749, 1-10224970364, 1-10288007948, 1-10308525090, 1-10722609370, 1-10899718757, 1-10902032523, 1-10983236675, 1-10984515031, 1-10878545783, 1-10877139796, 1-10875033436, 1-10880136537, 1-10863602348, 1-10760159027, 1-10718548262, 1-10973671148, 1-11005778240, 1-11064739084, 1-11171583914, 1-11224533234 ,\r\n1-11488916076',1464605407),(58,23,0,3,1,'Σε περιπτώσεις βλαβών με σύμπτωμα \"NO DHCP ANSWER/Εκκίνηση σε SAT MODE\" για DSLAM τεχνολογίας ISAM έχει επιβεβαιωθεί επίλυση με την αλλαγή της παραμέτρου \"Maximum number of mac addresses\" σε αριθμό μεγαλύτερο από 4. Πιθανόν το πρόβλημα να σχετίζεται και με την περίπτωση αποκατάστασης μετά από εναλλαγή από ATM σε PTM.   \r\n Η πρόταση ξεκίνησε από δοκιμή που έκανε συνάδελφος από το SOC Corp:\r\n\r\n [i]...παρατηρώ ότι γεμίζει η arp cache της πόρτας (ανώφλι 4 στο τρέχων configuration της ISAM) αφού   για κάποιο λόγο η πόρτα μαθαίνει και τις mac addresses των hosts που είναι directly connected στο microswitch του entry2i \r\nΤο ίδιο ίσχυε και στη δική μου περίπτωση αλλά και σε άλλους συνδρομητές σε ΙSAM dslams κατόπιν δειγματοληπτικού ελέγχου που έκανα.\r\nΔεν γνωρίζω αν αυτό συνιστά δυσλειτουργία (firmware bug) ή είναι φυσιολογικό (σχεδιαστική απόφαση) αλλά με όριο 4 (attribute Maximum number of mac addresses) η αριθμητική δεν βγαίνει διότι η πόρτα σίγουρα μαθαίνει και την mac address από το wan interface  , άρα στην περίπτωση που κάποιος καταλαμβάνει όλες τις πόρτες στο microswitch του entry2i οι mac addresses είναι minimum 5 (δεν βάζω την περίπτωση να έχει συνδέσει uplink switch στο entry2i).\r\nΣτην προκειμένη περίπτωση βλέπω από ACS ότι ο πελάτης έχει 11 hosts αυτή τη στιγμή στο lan του , η arp cache της πόρτας (στο dslam) έχει ήδη γεμίσει με mac addresses από hosts στο lan πελάτη και ΔΕΝ πρόλαβε να μάθει (αφού εξαντλήθηκε το όριο) την mac address του stb (94:3b:b1:e6:73:d3) , συνεπώς δεν μπορεί να μιλήσει το stb με την πλατφόρμα και δη με τον dhcp (IP address 0.0.0.0)...[/i] \r\n    ',1464687119),(59,23,0,3,1,'Σε περιπτώσεις βλαβών με σύμπτωμα \"NO DHCP ANSWER/Εκκίνηση σε SAT MODE\" για DSLAM τεχνολογίας ISAM έχει επιβεβαιωθεί επίλυση με την αλλαγή της παραμέτρου \"Maximum number of mac addresses\" σε αριθμό μεγαλύτερο από 4. Προς το παρόν παρατηρείται σε VDSL συνδρομητές χωρίς να αποκλείεται το ενδεχόμενο να αφορά και ADSL συνδρομητές. Η αλλαγή γίνεται μέσα από το Service IPTVoPTM ή το HSIoPTM (η αλλαγή περνάει και στα δύο services). Πιθανόν το πρόβλημα να σχετίζεται και με την περίπτωση αποκατάστασης μετά από εναλλαγή από ATM σε PTM που περιγράφεται σε άλλο ISSUE.   \r\n To case ξεκίνησε από δοκιμή που έκανε συνάδελφος από το SOC Corp:\r\n\r\n [i]...παρατηρώ ότι γεμίζει η arp cache της πόρτας (ανώφλι 4 στο τρέχων configuration της ISAM) αφού   για κάποιο λόγο η πόρτα μαθαίνει και τις mac addresses των hosts που είναι directly connected στο microswitch του entry2i \r\nΤο ίδιο ίσχυε και στη δική μου περίπτωση αλλά και σε άλλους συνδρομητές σε ΙSAM dslams κατόπιν δειγματοληπτικού ελέγχου που έκανα.\r\nΔεν γνωρίζω αν αυτό συνιστά δυσλειτουργία (firmware bug) ή είναι φυσιολογικό (σχεδιαστική απόφαση) αλλά με όριο 4 (attribute Maximum number of mac addresses) η αριθμητική δεν βγαίνει διότι η πόρτα σίγουρα μαθαίνει και την mac address από το wan interface  , άρα στην περίπτωση που κάποιος καταλαμβάνει όλες τις πόρτες στο microswitch του entry2i οι mac addresses είναι minimum 5 (δεν βάζω την περίπτωση να έχει συνδέσει uplink switch στο entry2i).\r\nΣτην προκειμένη περίπτωση βλέπω από ACS ότι ο πελάτης έχει 11 hosts αυτή τη στιγμή στο lan του , η arp cache της πόρτας (στο dslam) έχει ήδη γεμίσει με mac addresses από hosts στο lan πελάτη και ΔΕΝ πρόλαβε να μάθει (αφού εξαντλήθηκε το όριο) την mac address του stb (94:3b:b1:e6:73:d3) , συνεπώς δεν μπορεί να μιλήσει το stb με την πλατφόρμα και δη με τον dhcp (IP address 0.0.0.0)...[/i] \r\n    ',1464687960),(60,23,0,3,2,'Αλλαγή του Maximum number of mac addresses σε αριθμό πάνω από 4 και reboot STB.  ',1464687119),(61,23,0,3,2,'Αλλαγή του Maximum number of mac addresses σε αριθμό πάνω από 4 μέσα από το service IPTVoPTM ή HSIoPTM (η αλλαγή περνάει και στα δύο services) για VDSL συνδρομητές και IPTVoΑTM ή HSIoΑTM για ADSL συνδρομητές και reboot STB.  ',1464687960),(62,23,0,2,2,'Αλλαγή του Maximum number of m