έγχους:\r\n[list=1]\r\n[*]Έλεγχος από το Agama (και από cacti) για περίπτωση μαζικής βλάβης\r\n[*]Απενεργοποίηση της [b]Εξοικονόμησης ενέργειας[/b] από το STB\r\n[*]Δοκιμή με καλώδιο HDMI τύπου 1.4 ή 2.0 (αυτό που περιέχεται με τον εξοπλισμό είναι τύπου 1.3) ή με άλλου τύπου διασύνδεση STB - TV (SCART), πολύ πιθανόν τα μαυρίσματα να είναι πρόβλημα καλωδίου ή ασυμβατότητας. Το 1.3 τύπου καλώδιο μπορεί επίσης να δημιουργήσει και αλλοιώσεις ή και εναλλαγές στην ανάλυση στης εικόνας (επισυνάπτεται σχετική αλληλογραφία).\r\n[*]Έλεγχος της ανάλυσης και της αναλογίας της οθόνης, ανάλογα με την τεχνολογία της τηλεόρασης (π.χ. τηλεόραση παλαιού τύπου CRT πιθανόν να χρειάζεται την επιλογή 4:3), μέσα από το menu: [b]Ρυθμίσεις > Ρυθμίσεις Video > Αναλογία και ανάλυση[/b].\r\n[img]http://172.16.119.220:8080/upload/uploads/resolution.JPG[/img]\r\n[/list] Εάν δεν έχει εντοπιστεί πρόβλημα στους παραπάνω ελέγχους τότε προτείνεται η αλλαγή εξοπλισμού STB.',1466504734),(80,26,0,26,1,'Υπάρχει διαπιστωμένη αδυναμία Port Forwarding για το oxygen. Μία περίπτωση είναι η πόρτα 3389 (remote desktop protocol). ',1467197943),(81,26,0,2,1,'Υπάρχει διαπιστωμένη αδυναμία Port Forwarding για το oxygen.\r\nΟ λόγος είναι ότι η επιλογή [b]Connection [/b]δεν είναι ορατή στο interface του CPE με τα δικαιώματα που έχουν τα credentials που αναγράφονται κάτω από το modem.\r\n[img]http://172.16.119.220:8080/upload/uploads/oxy.jpg[/img]\r\n\r\n[i]Μία περίπτωση είναι η πόρτα 3389 (remote desktop protocol). [/i]',1467206910),(82,26,0,26,2,'Η λύση που προτείνεται από το Customer Experience Services Excellence Section περιγράφεται στο pdf. ',1467197943),(83,26,0,2,2,'Προς το παρόν τα cases προωθούνται με mail στο Δ. Μουρούκο για να παραμετροποιεί τα Port Forward με τη σωστή παράμετρο Connection.\r\n\r\nΣτα συννημένα υπάρχει pdf από το Customer Experience Services Excellence Section που περιγράφει τον τρόπο επίλυσης από τους τεχνικούς πεδίου σε συνεργασία με το BO.',1467206910),(84,23,0,13,3,'1-11500120099, 1-11