INSERT INTO `mantis_bug_text_table` VALUES (2,'Αφορά συνδρομητές VDSL. Tο STB δεν μπορεί να συνδεθεί στην πλατφόρμα και προχωράει σε SAT mode, εάν γίνει αλλαγή από ATM mode σε PTM mode (ή αντίστροφα) είτε από το DSLAM είτε από το Router το πρόβλημα αποκαθίσταται. Όταν γίνει επαναφορά στο αρχικό mode το πρόβλημα παραμένει. Αυτό ίσχυε μέχρι και 30/3 όπου εμφανίστηκε περίπτωση (1-10772129502,1-10790827977) στην οποία μετα την επαναφορά σε PTM mode (αφού πρώτα έγινε διαγραφή και επανεγγραφή του PTM) το πρόβλημα αποκαταστάθηκε.','Έχει σταλεί mail στο AN-NOC για διερεύνηση. ','1-10670104355 1-10696424798 1-10285972044,1-10989303400 1-11284146026 1-11469571585  1-11512948580 1-11528949657'),(8,'Μετά το release στις 17/04/2016 παρουσιάζονται καθυστερήσεις κατά το new assign (30sec~1min)\r\nΕνημέρη η Πηνελόπη Γερνά ώς Technical PM.','WorkAround: Δοκιμάσαμε με προσθήκη skill parameters και μειώνεται ο χρόνος',''),(3,'Εμφανίζεται μήνυμα \"Δεν επαρκεί η ταχύτητα για την προβολή του προγράμματος\" παρόλο που ο συγχρονισμός και το διαθέσιμο throughput είναι παραπάνω από αρκετά. ΕΠΙΣΗΣ ΑΝΑΦΕΡΕΙ ΌΤΙ ΑΠΟΤΥΓΧΑΝΟΥΝ ΟΙ ΕΓΓΡΑΦΕΣ. \r\n','Γίνονται οι εξής έλεγχοι:<ol><li>Συγχρονισμού</li><li>Διασύνδεσης STB - Router</li><li>Χρήση του διαθέσιμου από τον συγχρονισμό Bandwidth (αν και δεν θα έπρεπε αφού υπάρχει προτεραιότητα υπέρ της TVσε L2 στο managed δίκτυο)</li><li>Φορέα που εξυπηρετεί το DSLAM (εάν υπάρχει bottleneck στον φορέα θα φανεί στο Agama (1-10718988926)).</li></ol>Εάν δεν έχει εντοπιστεί το πρόβλημα στους παραπάνω ελέγχους, τότε προτείνεται η αλλαγή εξοπλισμού STB. ','1-9952443008, 1-107039439740 1-10877820747, 1-10106689749, 1-10224970364, 1-10288007948, 1-10308525090, 1-10722609370, 1-10899718757, 1-10902032523, 1-10983236675, 1-10984515031, 1-10878545783, 1-10877139796, 1-10875033436, 1-10880136537, 1-10863602348, 1-10760159027, 1-10718548262, 1-10973671148, 1-11005778240, 1-11064739084, 1-11171583914, 1-11224533234 ,\r\n1-11488916076, 1-11602357968, 1-11655856925'),(4,'Υπάρχει διαπιστωμένη δυσλειτουργία σε Wholesale Βλάβες (WTT) όταν απαιτείται από τον πάροχο συνδυαστικό ραντεβού.\r\nΑν προωθηθεί η βλάβη στο 3ο επίπεδο, δημιουργείται Activity προς Τ.Τ.Λ.Π αλλά το SR δεν φαίνεται ποτέ στο WFM των τεχνικών και η βλάβη μένει «χαμένη» και αχρέωτη.','','Μέχρι το πρόβλημα να διορθωθεί από την Πληροφορική, μπορούμε να το «αποφύγουμε» με ένα παραπάνω βήμα:\r\n\r\n1.	Για να επιβεβαιώσουμε αν ο πάροχος έχει ζητήσει συνδυαστικό ραντεβού, κοιτάμε στην πρώτη στήλη το πεδίο Originated W-CRM Id και στην τρίτη στήλη το checkbox Combined Appointment.\r\nΑν το πρώτο πεδίο αυτό έχει πάρει τιμή και το checkbox είναι επιλεγμένο, σημαίνει ότι ο πάροχος έχει ζητήσει συνδυαστικό. Αν η βλάβη σταλεί συνεργείο, θα μείνει εκκρεμότητα!\r\n2.	Αν απαιτείται συνεργείο, αφού γράψουμε το σχόλιό μας, πατάμε το Send to Next Level όπως συνήθως, και κοιτάζουμε το νέο Activity που δημιουργείται.\r\n3.	Το νέο Activity θα έχει ήδη ανατεθεί σε ένα συγκεκριμένο Τ.Τ.Λ.Π.\r\n4.	Αλλάζουμε το Owner Group, από SOC Internet TV, στο συγκεκριμένο Τ.Τ.Λ.Π., ώστε να το βλέπουν στο WFM.\r\n'),(5,'Στον πελάτη με CLΙ 2106542111 εμφανίζονται οι παρακάτω αποσυνδέσεις στο Αccounting.\r\nΒλέπουμε ότι στο username marfield αποδίδεται Ip που ξεκινά από 11.xxx. Επίσης φαίνεται και ένα domain name στο πεδίο NAS id.\r\n','',''),(6,'Δεν εμφανίζεται εικόνα ενώ από πίσω παίζει ο ήχος//Εναλλακτικό σύμπτωμα σπασίματα εικόνας και ήχου.\r\n\r\nΠροβλήματα εικόνας','Ενδέχεται να έχει βάλει τόσο το scart όσο και το hdmi στις θύρες του STB. Αφήνει μόνο το ένα. ',''),(7,'Το τελευταίο διάστημα δεχόμαστε καθημερινά  πλήθος βλαβών ευρυζωνικότητας  VPU-C παρόχου Forthnet τεχνολογίας Alcatel-ISAM όπου εξακριβωμένα δεν γίνεται  Switch to Alternate Service (PTM)  από τον APC της ISAM. \r\nO πάροχος έχει ενημερώσει για τον τρόπο λειτουργίας του μηχανισμού και διαβεβαιώνει ότι περιμένει ένα 48ωρο πριν την δήλωση αντίστοιχης βλάβης στο WCRM (είτε πρόκειται για δήλωση βλάβης από συνδρομητή του είτε για proactive action).\r\nΕίναι πρόβλημα που έχει εμφανιστεί μόνο με την Forthnet.\r\n\r\nΗ μάζα των συνδρομητών του ISP χρησιμοποιεί αυτή τη στιγμή τα παρακάτω CPEs έπειτα από ενημέρωση που είχαμε από το τμήμα Τεχνολογίας του.\r\nCPEs\r\n1. Technicolor TG788vn v2\r\n2. Technicolor TG588vn v3\r\n3. Technicolor TD5336v2 ( Μεμονωμένες περιπτώσεις, οπότε ας εστιάσουμε καλύτερα στα 2 πρώτα )','Δεν υπάρχει συγκεκριμένο pattern αναφορικά με τα CPEs καθώς εμφανίζεται στα 2. Επιπλέον, by default τα CPE έχουν ενεργοποιημένο WAN Sensing με Priority στο VDSL.',''),(9,'Οι ρυθμίσεις για incoming number στις πόρτες χάνονται μετά από Registration IMS','',''),(10,'Ο συνδρομητής δεν μπορεί να δει συγκεκριμένα κανάλια (δοκιμή με SCART ή με HDMI) τα οποία θα πρέπει να περιέχονται στο εμπορικό του πακέτο.','Έλεγχος από πλευράς SOC εάν υπάρχει πρόσβαση στην IP του συγκεκριμένου καναλιού στο VLAN 99 μέσω του NMS(Multicast Emulation για DSLAM Huawei μόνο/όπου υπάρχει). Σε περίπτωση που ο έλεγχος στο NMS δείξει ότι η IP του συγκεκριμένου καναλιού δεν δρομολογείται στο DSLAM γίνεται activity στο  NMC/DATA IP. Εναλακτικά μπορεί να γίνει έλεγχος από Agama ή Channel Tool (172.16.119.220:8080/Soctool) εάν η συγκεκριμένη IP του καναλιού έχει χρησιμοποιηθεί από κάποιον συνδρομητή στο DSLAM. Εάν ο έλεγχος δεν φέρει αρνητικό αποτέλεσμα γίνεται και πάλι activity προς NMC/DATA IP. ','1-8498640241'),(11,'Μαύρη εικόνα σε αρκετά κανάλια και εμφάνιση μηνύματος serial number: MAC STB στην οθόνη//Αφορά μόνο τα Huawei Dslams','Υπό διερεύνηση, υπήρχε περίπτωση επίλυσης από SOC με αλλαγή max programs από 3 σε 6. Έχει σταλεί σχετικό mail στις αρμόδιες υπηρεσίες, δεν έχουμε λάβει ακόμα απάντηση. Σε περίπτωση μη αποκατάστασης γίνεται activity στο [b]NMC/DATA IP[/b] ','1-9342839570'),(12,'Μαύρη εικόνα σε όλα τα κανάλια μετά το boot, το mini epg εμφανίζεται κανονικά. ','Αφορά DSLAM τεχνολογίας ISAM.\r\nΑφού έχουμε πιστοποιήσει ότι το πρόβλημα δεν οφείλεται σε άλλη αιτία που (πρόβλημα multicast κίνησης προς το DSLAM) γίνεται αποστολή mail και activity στο NMC/DATA IP για παραμετροποίηση των profiles ανά DSLAM από AN-NOC.','1-10156522166'),(13,'Ο συνδρομητής με την χρήση του HDMI δεν βλέπει κάποια κανάλια συνήθως Otesport και  και OTE Cinema (βλέπει μόνο το OTE Cinema 3). Ενώ με το SCART τα βλέπει όλα//Με το τελευταίο firmware STB βγαίνει pop up παράθυρο που ειδοποιεί για \'hdcp protocol\'','Τα κανάλια αυτά είναι protective μέσω του προτοκόλου HDCP και κάποιες τηλεοράσεις δεν μπορούν να τα δουν μέσω HDMI. Ζητήθηκε από την πλατφόρμα να γίνεται καταγραφή του μοντέλου της τηλεόρασης. Ενημέρωση με mail στο HTVNOC. Με το νέο fw update σε 2.2.1.1 θα προστεθούν επιπλέον μοντέλα τηλεοράσεων που θα υποστηρίζουν το προτόκολλο HDCP. Η βλάβη γίνεται άρση και ενημερώνεται ο συνδρομητής.','1-8696745236 1-8741620587'),(14,'Μετά το boot του STB τεχνολογίας Pirelli ή ADB εμφανίζεται μήνυμα στην οθόνη \"Boot Error: 001,003,021\". Όταν το STB είναι τεχνολογίας ΚΑΟΝ ή TECHNICOLOR εμφανίζεται μήνυμα στην οθόνη \"Σύνδεση μέσω Δορυφόρου\"',' Το συγκεκριμένο πρόβλημα προκύπτει από την αδυναμία του STB να συνδεθεί στην πλατφόρμα. Γίνεται πρώτα έλεγχος παραμετροποίησης της πόρτας του DSLAM, έλεγχος πρόσβασης του DSLAM στην πλατφόρμα (Agama, Multicast Emulation, Channel Tool, TV Tool, NMS κ.λ.π.), έλεγχος σωστής συνδεσμολογίας συσκευών στον χώρο του συνδρομητή, έλεγχος των power plugs εάν υπάρχουν, επανεκκίνηση συσκευών STB και router. Εάν το πρόβλημα δεν επιλυθεί και δεν μπορούμε να πιστοποιήσουμε με κάποιο τρόπο ότι υπάρχει σύνδεση μεταξύ DSLAM και πλατφόρμας γίνεται activity στο NMC/DATA IP. Εναλακτικά, όταν μπορούμε να πιστοποιήσουμε την σύνδεση του DSLAM με την πλατφόρμα και το πρόβλημα δεν έχει επιλυθεί γίνεται αποστολή σε επίπεδο συνεργείου με τα σχετικά σχόλια.     ','1-8668454582  1-8725660233 1-9303136971 1-9918389240 1-10846086953'),(15,'Όταν ο συνδρομητής επιχειρεί να κάνει Registration για πρώτη φορά ή με καινούργιο εξοπλισμό STB και εμφανίζεται το μήνυμα \"Έχετε φτάσει στον μέγιστο αριθμό STB\"','Υπάρχει ήδη γραμμένο STB στην πλατφόρμα για το SID του συνδρομητή και για να γίνει η διαγραφή του θα πρέπει να γίνει remedy στην πληροφορική. Αυτό συμβαίνει συχνά όταν ο συνδρομητής κατά την διαδικασία αλλαγής εξοπλισμού STB παραλαμβάνει το νέο εξοπλισμό από το κατάστημα χωρίς όμως να έχει αποσυνδέσει τον παλιό από την γραμμή του. Στο κατάστημα, περνιούνται νέα στοιχεία στην πλατφόρμα για τον συνδρομητή και διαγράφεται το παλιό STB έτσι ώστε στην θέση του να γραφτεί το νέο. Εάν ο συνδρομητής επανεκκινήσει το παλιό STB, που βρίσκεται πάνω στην γραμμή, πριν βάλει το καινούργιο που έχει παραλάβει τότε παρουσιάζεται το εν λόγω πρόβλημα. Από τις αρχές Απριλίου μπορούμε να κάνουμε Delete (unbinding) της εγγραφής (STB MAC-UID) και στην νέα Hybrid πλατφόρμα της HUAWEI.  ','1-9165882171  1-9397619424 1-10139363624'),(16,'Ασυμβατότητα με HDMI 4k TV (Samsung UE55 JF9000)','Ασυμβατότητα στο hdmi της τηλεόρασης του//Τον βάζουμε να δοκιμάσει με καλώδιο SCART ή άλλου τύπου διασύνδεση STB με TV. Γίνεται κοινοποίηση της πληροφορίας για τον τύπο της τηλεόρασης του συνδρομητή στο HTVNOC με mail.','1-9175617820'),(17,'Ο συνδρομητής αναφέρει ότι βλέπει μαυρίσματα στην εικόνα και όχι σπασίματα (αλλοιώσεις) όπως αναφέρει το TT Symptom. Σε αυτήν την περίπτωση η εικόνα μαυρίζει για μερικά δευτερόλεπτα και επανέρχεται από μόνη της χωρίς σταθερή περιοδικότητα.','Τα μαυρίσματα στην εικόνα πιθανόν να μην οφείλονται σε πρόβλημα του δικτύου χαλκού.\r\nΑφού έχουμε κάνει όλους τους γνωστούς ελέγχους που αφορούν την τεχνολογία του DSL κάνουμε τους παρακάτω ελέγχους:\r\n[list=1]\r\n[*]Έλεγχος από το Agama (και από cacti) για περίπτωση μαζικής βλάβης\r\n[*]Απενεργοποίηση της [b]Εξοικονόμησης ενέργειας[/b] από το STB\r\n[*]Δοκιμή με καλώδιο HDMI τύπου 1.4 ή 2.0 (αυτό που περιέχεται με τον εξοπλισμό είναι τύπου 1.3) ή με άλλου τύπου διασύνδεση STB - TV (SCART), πολύ πιθανόν τα μαυρίσματα να είναι πρόβλημα καλωδίου ή ασυμβατότητας. Το 1.3 τύπου καλώδιο μπορεί επίσης να δημιουργήσει και αλλοιώσεις ή και εναλλαγές στην ανάλυση στης εικόνας (επισυνάπτεται σχετική αλληλογραφία).\r\n[*]Έλεγχος της ανάλυσης και της αναλογίας της οθόνης, ανάλογα με την τεχνολογία της τηλεόρασης (π.χ. τηλεόραση παλαιού τύπου CRT πιθανόν να χρειάζεται την επιλογή 4:3), μέσα από το menu: [b]Ρυθμίσεις > Ρυθμίσεις Video > Αναλογία και ανάλυση[/b].\r\n[img]http://172.16.119.220/upload/uploads/resolution.JPG[/img]\r\n[/list] Εάν δεν έχει εντοπιστεί πρόβλημα στους παραπάνω ελέγχους τότε προτείνεται η αλλαγή εξοπλισμού STB.','1-10848611934, 1-10957034207'),(18,'Το STB κάνει εκκίνηση και ξεκινάει η αναβάθμιση η οποία σταματάει στο 0% ή 50%. ','Πρέπει να γίνει έλεγχος σύνδεσης STB-Router. Εάν η σύνδεση είναι OK προτείνεται  H/W Reset του εξοπλισμού και εάν μπορεί να γίνει χειροκίνητα Force Upgrade, εάν αυτό δεν είναι δυνατόν τότε προτείνεται η αντικατάσταση εξοπλισμού STB.   ','1-8630273232 1-8527977178  1-9595841075 1-10848373259'),(19,'Εμφανίζεται μήνυμα \"Η υπηρεσία replay tv δεν περιλαμβάνεται στη συνδρομή σας.\"','Έχει αλλάξει πλέον ο τρόπος δημιουργίας δικαιωμάτων των χρηστών. Το replay tv αντί να περνιέται by default \"πέφτει\" ως ξεχωριστό αίτημα στους νέους συνδρομητές.Το ζήτημα είναι γνωστό στο ΙΤ και αναμένουμε αποκατάσταση, ενδεχομένως κάποιες περιπτώσεις να επιλυθούν με STT πλέον (παλιά με remedy). Γίνεται επικοινωνία με πρώτο επίπεδο για αποστολή σε αυτόυς activity.   ','1-11024726558 '),(20,'Ο συνδρομητής εισάγει το SID και το νούμερο της συνδρομητικής κάρτας και όταν πατήσει το κουμπί OK εμφανίζεται το μύνημα: «Λάθος PIN συνδρομητικής κάρτας»','-Το πρόβλημα αυτό παρατηρείται σε περιπτώσεις πρώτης σύνδεσης με την νέα HYBRID πλατφόρμα ή μετά από αλλαγή εξοπλισμού STB (KAON, TECHNICOLOR). To προβλημα προκύπτει από την ροή του IT όπου δεν καταφέρνει να περάσει τα στοιχεία του νέου εξοπλισμού στην πλατφόρμα. Σε αυτή την περίπτωση θα πρέπει να γίνει έλεγχος εάν ο συνδρομητής βάζει τα σωστά στοιχεία και αφού επιβεβαιωθεί αυτό γίνεται activity στην πλατφόρμα TV για έλεγχο (αν όντως πρόκειται για αυτήν την περίπτωση). Εάν η πλατφόρμα TV επιβεβιαώσει το πρόβλημα τότε γίνεται επικοινωνία και activity με το 1st Level προκειμένου να αποσταλεί STT (αντικατάσταση της διαδικασίας Remedy) στο IT για αποκατάσταση του προβλήματος.\r\n\r\n-Μία άλλη αιτία (πολύ πιο σπάνια) που μπορεί να προκαλεί το σύμπτωμα είναι να μην έχει ολοκληρωθεί η διαδικασία αλλαγής εξοπλισμού STB ή παραλαβής νέου STB από την παραγγελιοληψία (λάθος εμπορικού). Σε αυτήν την περίπτωση πρέπει πάλι να ενημερωθεί το πρώτο επίπεδο προκειμένου να αποκταστήσει το πρόβλημα (βλέπε συν. email).',''),(21,'Παρατηρήθηκε case στο backoffice σε βλάβη με σύμπτωμα αδυναμία προβολής καναλιών IPTV.\r\n\r\nΜετά από δοκιμές με το Argus έβλεπε εικόνα κανονικά (Βλέπει το stream της εικόνας να κατεβαίνει), ενώ το πρόβλημα με το STB δεν αποκαταστάθηκε ούτε με δύο αλλαγές router.\r\n\r\nΤελικώς παρατηρήθηκε ότι η πόρτα είχε profile PROF_IPTV_24M. Μετά από [b]αλλαγή σε PRF_24M_TV[/b] το πρόβλημα αποκαταστάθηκε.','Απάντηση από Α. Ρενιέρη:\r\n\r\n[b]Δυστυχώς με τα MA5606Τ τα πράγματα είναι λίγο περίπλοκα. Αυτή τη στιγμή ο συγκεκριμένος τύπος DSLAM είναι end-of-support από την Huawei και έχουμε κινήσει διαδικασίες για να προχωρήσουμε στην αντικατάστασή τους από άλλον τύπο DSLAM (πιθανότατα από MA5616). Μετά την τελευταία αναβάθμιση που έγινε σε αυτά παρουσιάζουν πολλές δυσλειτουργίες.\r\n\r\nΕν προκειμένω οι λύσεις για προβλήματα IPTV σαν κι αυτό που περιγράφεις είναι δυο. Ή αυτή που εφαρμόσατε ή αντικατάσταση του IPTV traffic profile με IPTV2 traffic profile.[/b]\r\n\r\n--------------\r\n\r\n[i]Παρακαλώ να γίνει ξανά δοκιμή στο προηγούμενο profile ώστε να διαπιστωθεί αν φταίει το ίδιο το profile ή αν η εναλλαγή profile αποκαθιστά το πρόβλημα.[/i]','No SR ( 2695035365 - 10726:3/31), 1-11732424279'),(22,'Τα νέα version είναι 24/5/2016:\r\nMRS (middleware) 2.2.1\r\nEPG template 7203\r\n\r\n','ΣΕ ΠΕΡΙΠΤΩΣΗ ΠΟΥ ΕΧΟΥΜΕ STB ΜΕ ΠΡΟΒΛΗΜΑ ΣΤΗΝ ΑΝΑΒΑΘΜΙΣΗ (ΔΕΝ ΞΕΚΙΝΑΕΙ-ΔΕΝ ΣΥΝΕΧΙΖΕΙ \"ΚΟΛΛΑΕΙ\")\r\n\r\n1. ΕΛΕΓΧΟΣ ΣΥΝΔΕΣΜΟΛΟΓΙΑΣ ROUTER-STB (POWER PLUGS- ETHERNET)\r\n2. RESET ROUTER -REBOOT STB\r\n3. FORCE UPGRADE\r\nΚατά την έναρξη του booting πατάει από το τηλεκοντρόλ back 2465 -> i -> yellow button. Στην οθόνη που εμφανίζεται ο συνδρομητής συμπληρώνει τον TFTP:  010.001.021.016 και την port:00069 και πατάει ΟΚ.\r\nΗ ενέργεια αυτή μπορεί να γίνει και από το L1 του OTE TV.\r\n\r\n4. ΑΝΤΙΚΑΤΑΣΤΑΣΗ STB ',''),(23,'Σε περιπτώσεις βλαβών με σύμπτωμα \"NO DHCP ANSWER/Εκκίνηση σε SAT MODE\" για DSLAM τεχνολογίας ISAM έχει επιβεβαιωθεί επίλυση με την αλλαγή της παραμέτρου \"Maximum number of mac addresses\" σε αριθμό μεγαλύτερο από 4. Προς το παρόν παρατηρείται σε VDSL συνδρομητές χωρίς να αποκλείεται το ενδεχόμενο να αφορά και ADSL συνδρομητές. Η αλλαγή γίνεται μέσα από το Service IPTVoPTM ή το HSIoPTM (η αλλαγή περνάει και στα δύο services). Πιθανόν το πρόβλημα να σχετίζεται και με την περίπτωση αποκατάστασης μετά από εναλλαγή από ATM σε PTM που περιγράφεται σε άλλο ISSUE.   \r\n To case ξεκίνησε από δοκιμή που έκανε συνάδελφος από το SOC Corp:\r\n\r\n [i]...παρατηρώ ότι γεμίζει η arp cache της πόρτας (ανώφλι 4 στο τρέχων configuration της ISAM) αφού   για κάποιο λόγο η πόρτα μαθαίνει και τις mac addresses των hosts που είναι directly connected στο microswitch του entry2i \r\nΤο ίδιο ίσχυε και στη δική μου περίπτωση αλλά και σε άλλους συνδρομητές σε ΙSAM dslams κατόπιν δειγματοληπτικού ελέγχου που έκανα.\r\nΔεν γνωρίζω αν αυτό συνιστά δυσλειτουργία (firmware bug) ή είναι φυσιολογικό (σχεδιαστική απόφαση) αλλά με όριο 4 (attribute Maximum number of mac addresses) η αριθμητική δεν βγαίνει διότι η πόρτα σίγουρα μαθαίνει και την mac address από το wan interface  , άρα στην περίπτωση που κάποιος καταλαμβάνει όλες τις πόρτες στο microswitch του entry2i οι mac addresses είναι minimum 5 (δεν βάζω την περίπτωση να έχει συνδέσει uplink switch στο entry2i).\r\nΣτην προκειμένη περίπτωση βλέπω από ACS ότι ο πελάτης έχει 11 hosts αυτή τη στιγμή στο lan του , η arp cache της πόρτας (στο dslam) έχει ήδη γεμίσει με mac addresses από hosts στο lan πελάτη και ΔΕΝ πρόλαβε να μάθει (αφού εξαντλήθηκε το όριο) την mac address του stb (94:3b:b1:e6:73:d3) , συνεπώς δεν μπορεί να μιλήσει το stb με την πλατφόρμα και δη με τον dhcp (IP address 0.0.0.0)...[/i] \r\n    ','Αλλαγή του Maximum number of mac addresses σε αριθμό πάνω από 4 μέσα από το service IPTVoPTM ή HSIoPTM (η αλλαγή περνάει και στα δύο services) για VDSL συνδρομητές και IPTVoΑTM ή HSIoΑTM για ADSL συνδρομητές και reboot STB.  \r\n\r\n[img]http://172.16.119.220:8080/upload/uploads/MAC_ISAM_Edit.PNG[/img]','1-11500120099, 1-11395843589, 1-11600684437, 1-11631604214, 1-11657810522, 1-11992861780'),(24,'Το Replay TV λειτουργεί κανονικά αλλά κάποιο από τα προγράμματα σταματάει σε συγκεκριμμένη χρονική στιγμή.\r\nΣε άλλες περιπτώσεις, πετάει τον συνδρομητή πίσω στο menu ή εμφανίζεται το μήνυμα \'η λήψη δεν εχει ολοκληρωθεί παρακαλώ περιμένετε\'. \r\nΑφορά συνδρομητές που έχουν σκληρό δίσκο και για κάποιο λόγο κόλησε/σταμάτησε η εγγραφή.','Αρχικώς ελέγχουμε ότι δεν είναι μαζικό. Ενημερώνουμε τον συνδρομητή να αφαιρέσει τον σκληρό και να δει το πρόγραμμα δικτυακά. Αν δεν παίζει δικτυακά λόγω κακής ποιότητας μπορούμε να προτείνουμε format στον σκληρό(εφόσον το επιθυμεί) και επανεγγραφή.','1-11585825474'),(25,'Τελευταία έχει παρατηρηθεί το εξής πρόβλημα. Προγραμματίζονται μεταγωγές σε msan όπου πριν γίνει η μικτονόμιση γίνεται το provisioning στο ims με εγγραφή στον ENUM Server (ENS) όπου αυτό επηρεάζει τις κλήσεις που δέχονται αυτοί οι αριθμοί μέσο του ims όπως vobb/msan πελάτες. To σύμπτωμα είναι πως δείχνει να χτυπάει αλλά δεν χτυπάει στον χώρο.  ','Σε αυτή τη περίπτωση είτε θα εξηγήσουμε στον πελάτη πως γίνεται αναβάθμιση στο δίκτυο και θα πρέπει να περιμένει τη ολοκλήρωση είτε θα προωθήσουμε την βλάβη στο nmc-voice ώστε να καταργήσουν την εγγραφή στο ens. Αυτό βέβαια θα δημιουργήσει πρόβλημα όταν ολοκληρωθεί η μεταγωγή οπού δεν θα δέχονται κλήσεις από ims πελάτες!',''),(26,'Υπάρχει διαπιστωμένη αδυναμία Port Forwarding για το oxygen.\r\nΟ λόγος είναι ότι η επιλογή [b]Connection [/b]δεν είναι ορατή στο interface του CPE με τα δικαιώματα που έχουν τα credentials που αναγράφονται κάτω από το modem.\r\n[img]http://172.16.119.220:8080/upload/uploads/oxy.jpg[/img]\r\n\r\n[i]Μία περίπτωση είναι η πόρτα 3389 (remote desktop protocol). [/i]','Προς το παρόν τα cases προωθούνται με mail στο Δ. Μουρούκο για να παραμετροποιεί τα Port Forward με τη σωστή παράμετρο Connection.\r\n\r\nΣτα συννημένα υπάρχει pdf από το Customer Experience Services Excellence Section που περιγράφει τον τρόπο επίλυσης από τους τεχνικούς πεδίου σε συνεργασία με το BO.',''),(27,'Στις μετατροπές isdn -> pstn & pstn -> isdn δεν γίνεται αλλαγή ορίου σε κάρτα που συμφωνεί με τον τύπο γραμμής του πελάτη αλλά δίνεται στον πελάτη νέο cpe το οποίο συμφωνεί με τον τύπο γραμμής. Για παράδειγμα στην περίπτωση isdn->pstn ο πελάτης παραμένει στο ίδιο όριο (χάνοντας εύρος συχνοτήτων απο το φάσμα του) αλλά παραλαμβάνει cpe (speedport) τύπου annex-b το οποίο έχει ως αποτέλεσμα με την εγκατάσταση του να μην επιτυγχάνεται συγχρονισμός. ','1) Ενημέρωση πελάτη για εγκατάσταση του προηγούμενου router εφόσον είναι διαθέσιμο. Αυτό επιλύει μερικώς το πρόβλημα αφού σε ενδεχόμενη αντικατάσταση router σε κατάστημα η με την μορφή courier θα του αποδοθεί λάθος τύπου cpe το οποίο θα επαναφέρει το αρχικό πρόβλημα.\r\n2) Αποστολή συνεργείου για αλλαγή ορίου που να συμφωνεί με τον τύπο γραμμής του πελάτη.  ',''),(28,'Στις παραγγελίες με υπο-τύπο αίτησης: change username δίνεται νέο username στον πελάτη κάνοντας deactivate το παλιό ως expired user χωρίς να έχει γίνει πρώτα provisioning από acs με το νέο username με αποτέλεσμα να μην παίρνει ip το router.','Δεν χρειάζεται πλέον αλλαγή username σε change owner. Αναμένεται να γινει διαμόρφωση της ροής. ',''),(29,'Έχουμε παρατηρήσει ότι συμβαίνουν τα εξής προβλήματα όταν βλέπουμε εντολή στο Π.Σ. Προμηθέας για  ΑΛΛΑΓΗ ΠΑΡΟΧΟΥ ΠΤοΒ σε κυκλώματα VPU.\r\n\r\n1) Εκκρεμούσα Κατάργηση ΑΡΥΣ από έναν Πάροχο όταν υπάρχει ήδη κατασκευασμένο κύκλωμα VPU σε νέο πάροχο (In Service Ορίο). Η περίπτωση αυτή παρατηρείται όταν πραγματοποιείται αλλαγή ορίου κατά την αλλαγή παρόχου.\r\nΣυγκεκριμένα, όταν ένας συνδρομητής ζητήσει να αλλάξει πάροχο, οι ροές του NISA τρέχουν ταυτόχρονα και όχι σειριακά, με αποτέλεσμα να δημιουργείται σύγχυση στο L2 (κατά την δήλωση βλάβης)\r\n\r\n2) Λανθασμένη αποτύπωση του SVLAN1 (αποτύπωση VLAN του προηγούμενου παρόχου) ενώ έχει ήδη κατασκευαστεί το κύκλωμα VPU-C στον νέο πάροχο. Η περίπτωση αυτή παρατηρείται όταν δεν έχουμε αλλαγή ορίου.\r\n','Υπό διερεύνηση','Loop Numbers: 21Β1403310, 21Β2193620, 21Β2291951, 21Β1495347, 21Β1964250\r\n'),(30,'Περιπτώσεις VPU-C κυκλωμάτων από Forthnet (συγχρονίζει σε adsl2+) τεχνολογίας ISAM που εξακριβωμένα δεν μπορεί να γίνει manually switch to PTM.\r\n(ενώ επιχειρείται από μας switching to PTM Service, κάνει fallback σε ATM Service.)\r\n\r\nΤο συγκεκριμένο φαινόμενο συμβαίνει με τα CPEs Technicolor TD5336v2 όπου ο πάροχος έχει διαθέσει σε ευρεία κυκλοφορία το τελευταίο διάστημα (~21/9/2016).\r\nΟι συγκεκριμένες περιπτώσεις δεν σχετίζονται με το γνωστό πρόβλημα που εξακολουθεί και υφίσταται με την αποτυχία λειτουργίας του APC.\r\nΧαρακτηριστικά είδαμε ότι για να μπορέσουν να συγχρονίσουν τα εν λόγω κυκλώματα σε G.993.2 (VDSL2 transmission mode) θα πρέπει να προηγηθεί reset στο CPE και έπειτα να ακολουθήσει switch to PTM manually.\r\n\r\n\r\nΕνημερώθηκε και ο πάροχος ότι ίσως υπάρχει κάποιο πρόβλημα με το WAN Sensing και το Priority σε VDSL.\r\n','Πρέπει να προηγηθεί reset CPE από τον πάροχο και μετά να γίνει switch σε PTM SRV από SOC.','Loop Numbers:\r\n2101612133\r\n21Β1085761\r\n21Β2352375\r\n21Β2535115');
/*!40000 ALTER TABLE `mantis_bug_text_table` ENABLE KEYS */;
