INSERT INTO `mantis_bugnote_text_table` VALUES (3,'Από τη συνάντηση με τον Π. Παναικολάου και τα εργαστήρια:\r\n\r\nΠρόκειται για αποσυνδέσεις σε FON του εξωτερικού (roaming user). Όταν γίνεται χρήση της υπηρεσίας My WiFi (FON) σε δίκτυο άλλης χώρας, η IP ανήκει από το pool που δίνει ο εκάστοτε πάροχος, και όχι δική μας.'),(2,'ΑΝΤΙΚΑΤΑΣΤΑΣΗ STB KAI ΔΕΝ ΤΟΥ ΒΓΑΖΕΙ ΠΛΕΟΝ ΤΟ ΜΗΝΥΜΑ ΓΙΑ ΕΛΕΓΧΟ ΤΑΧΥΤΗΤΑΣ.'),(4,'Γιάννης Κριθαράς:\r\n\r\nThird-party accounting δεχόμαστε από το Fon Appliance. Οπότε σε περίπτωση που δικός μας user κάνει χρήση της υπηρεσίας έξω, όντως θα δούμε \"παράξενο\" addressing και NAS πληροφορία.'),(5,'Ενδέχεται να έχει βάλει τόσο το scart όσο και το hdmi στις θύρες του STB. Αφήνει μόνο το ένα.'),(6,'Καλησπέρα,\r\n\r\nΤο πρόβλημα είναι γνωστό και την προηγούμενη εβδομάδα πραγματοποιήθηκε συνάντηση με Σχεδιασμό και ALU για την εξεύρεση λύσης.\r\nΕπιφυλάσσομαι να απαντήσουμε αύριο αναλυτικότερα.\r\n\r\nΕυχαριστώ,\r\n\r\nΝίκος Μαντζαβέλας'),(7,'Για το συγκεκριμένο θέμα μιλήσαμε σήμερα τον Σωτήρη και δόθηκε η απαιτούμενη πληροφόρηση.\r\nΣε γενικές γραμμές, η αιτία εμφάνισης αυτού του «φαινομένου» (και κατ’ επέκταση προβλήματος) συνοψίζεται στον «κορεσμό» της λύσης (δεν είναι ωφέλιμη η αναφορά σε τεχνικές λεπτομέρειες) για το automatic switching από ATM σε PTM mode. Στη συνάντηση που αναφέρεται στο προηγούμενο email μου συζητήθηκαν διάφορες προτάσεις αντιμετώπισης του προβλήματος, αλλά δεν καταλήξαμε σε κάποια.\r\nΟ Θοδωρής Θεοδωρόπουλος ανέλαβε να επικοινωνήσει τις προτάσεις στον Κώστα Μπουκουβάλα, καθώς μερικές από αυτές χρήζουν της σύμφωνης γνώμης και των εμπορικών υπηρεσιών. Τελούμε σε αναμονή των αποτελεσμάτων αυτής της επικοινωνίας.\r\n\r\nΝίκος Μαντζαβέλας'),(8,'Το μη ωφέλιμο της αναφοράς σε τεχνικές λεπτομέρειες ουδόλως σχετίζεται με την ύπαρξη τεχνικού background ή όχι από τους παραλήπτες της αλληλογραφίας.  Σχετίζεται μόνο με το ότι δεν προσφέρει κάτι ουσιαστικό στους παραλήπτες της πληροφορίας. Έχει να κάνει μόνο με το “Respect Resources”.\r\nΣ’ ότι αφορά τις ενέργειες οριστικής επίλυσης του προβλήματος, θεωρώ ότι είναι σαφές το «…συζητήθηκαν διάφορες προτάσεις αντιμετώπισης του προβλήματος, αλλά δεν καταλήξαμε σε κάποια. Ο Θοδωρής Θεοδωρόπουλος ανέλαβε να επικοινωνήσει τις προτάσεις στον Κώστα Μπουκουβάλα, καθώς μερικές από αυτές χρήζουν της σύμφωνης γνώμης και των εμπορικών υπηρεσιών. Τελούμε σε αναμονή των αποτελεσμάτων αυτής της επικοινωνίας.»\r\n\r\nΝίκος Μαντζαβέλας'),(9,'Το πρόβλημα ξαναπαρουσιάστηκε σε κάποιον συνδρομητή αλλά αυτή την φορά αποκαταστάθηκε.\r\n\r\nΠαρακάτω το σενάριο της βλάβης όπως το περιγράφει ο συνάδελφος Σίσκος Πασχάλης:\r\n\r\nΣτο 1-10772129502/2109689591 σε ptm mode έβγαζε δορυφορικό menu.\r\nΕίχε πάει συνεργείο, είχει δοκιμάσει με άλλο Modem και έγινε και αλλαγή stb.\r\nΜε switch to atm έπαιξε και κατέβασε firmware -  middleware.\r\nΚάνοντας delete/create ptm service και switch to ptm λειτούργησε κανονικά.\r\n\r\nΗ επίλυση δόθηκε πιθανώς από (;)\r\n\r\nDelete/create vlan.\r\nΤο firmware που κατέβηκε στο stb.\r\nTo γεγονός ότι  γράφτηκε η mac στην πλατφόρμα για πρώτη φορά μέσω asr.'),(10,'Έχει αποσταλεί προς NMC το SR 1-10790827977\r\nΠρόκειται για συνδρομητή VDSL με IPTV.\r\nΣε PTM mode τον βγάζει σε SAT μενού ενώ σε χειροκίνητη αλλαγή σε ATM έπαιξε κανονικά.\r\nΚατασκευάστηκε εκ νέου το PTM mode και έπαιξε κανονικά. \r\nΈγινε σωστά η εγγραφή του χρήστη και βλέπει κανονικά όλα τα κανάλια.');
/*!40000 ALTER TABLE `mantis_bugnote_text_table` ENABLE KEYS */;
